import './App.css';

import { BrowserRouter, Router, Route } from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/'>
            <Route index element={<HelloWorld />} />
            <Route path='/nextpage' element={<NextPage />} />
          </Route>

          <Route path='/dashboard/'>
            <Route index element={<MyForm />} />
            <Route path='nextpage' element={<NextPage />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
